function type(t){return typeof t}function int(t,n=10){return parseInt(String(t),n)}function float(t){return parseFloat(String(t))}function str(t){return String(t)}function len(t){return t.length}function range(){let t,n,r;1==arguments.length?[t,n,r]=[0,arguments[0],1]:2==arguments.length?[t,n,r]=[arguments[0],arguments[1],1]:[t,n,r]=[arguments[0],arguments[1],arguments[2]];let e=[];if(r>0)for(let o=t;o<n;o+=r)e.push(o);else for(let o=n;o>t;o-=r)e.push(o);return e}function round(t,n){return Math.round(t*10**n)/10**n}function chr(t){return String.fromCharCode(t)}function ord(t){return t.charCodeAt(0)}class random{static random(){return Math.random()}static randint(t,n){return Math.ceil(Math.random()*(n-t+1))+t-1}static choice(t){return t[Math.ceil(Math.random()*t.length)-1]}static shuffle(t){let n=!1,r=t.length;"string"==typeof t&&(t=t.split(""),n=!0);let e=[];for(let n=0;n<r;n++)e.push(t.splice(Math.ceil(Math.random()*t.length)-1,1)[0]);return n?e.join(""):e}}print=console.log;